import React from 'react';

const PalettePreview = ({ palette }) => {
  return (
    <article>
      <p>{palette.name}</p>
      <div className='preview-grid'>
        {palette.colors.map(color => (
          <div
            className='preview-cell'
            key={color.hex}
            style={{ backgroundColor: `${color.hex}` }}
          ></div>
        ))}
      </div>
    </article>
  );
};

export default PalettePreview;
